import React from 'react';

const Students = (props) => {
  const renderStudents = students.map((student, index)=>
  <div key={index}>
  <li>
  <h3> Name: {student}</h3>
  </li>
  </div>
)
  return (
    <div>
      <h1>Students</h1>
      <ul>{renderStudents}</ul>
    </div>
  );
};

export default Students;
